const ListePersonnel = (props) => {
    console.log(props.personnes)
    const style = {
        container : {
            border : "1px solid gray",
            borderRadius : 5,
            padding : 5,
            marginTop : 15,
        },
        label : {
            letterSpacing : 5
        }
    }

    return (
        <>
            <div style={style.container}>
                <p style={style.label}>Nom : </p>
                <p style={style.label}>Prenom : </p>
                <p style={style.label}>Age : </p>
                <p style={style.label}>Genre : </p>
            </div>
        </>
    )
}


export default ListePersonnel
